Rules.InvariantScript:
With(
    {
        nomes: Split(User().FullName, " "), // Divide o nome completo em partes
        primeiroNome: First(Split(User().FullName, " ")).Value, // Obtm o primeiro nome
        segundoNome: Last(FirstN(Split(User().FullName, " "), 2)).Value // Obtm o segundo nome (se existir)
    },
    If(
        CountRows(nomes) = 1, 
        Left(primeiroNome, 2), // Caso s tenha um nome, pega as duas primeiras letras
        If(
            Len(segundoNome) < 4,
            Concatenate(
                Left(primeiroNome, 1),
                If(CountRows(nomes) > 2, Left(Last(FirstN(nomes, 3)).Value, 1), Left(segundoNome, 1))
            ), // Se o segundo nome for curto, pega o primeiro e a inicial do terceiro nome (se existir), caso contrrio pega o segundo mesmo
            Concatenate(Left(primeiroNome, 1), Left(segundoNome, 1)) // Pega a primeira letra do primeiro nome e do segundo nome normalmente
        )
    )
)
